import React, { Component, useState } from 'react';
import "../../Estilos/Principal.css";
import "../../Estilos/formgusuarios.css";
import IMG from '../../Imagenes/IMG';

const GComunicaciones = () => {

const [todosLosDatos, setTodosLosDatos] = useState([]);

const eliminarDato = (index) => {
    // Elimina el dato correspondiente al índice proporcionado
    const nuevosDatos = [...todosLosDatos];
    nuevosDatos.splice(index, 1);
    setTodosLosDatos(nuevosDatos);
};

    return (
        <div>
            <div>
                <div style={{ width: '1250px' }}>
                    <header className="custom-header" >
                        <h1>INTRANET-DTDS</h1>
                        <h1 style={{ marginLeft: '400px' }}>Servicio de Gestion de Comunicaciones</h1>
                        <img src={IMG.lg1} alt="" style={{ width: '30%', height: '50px', marginLeft: '70%', marginTop: '-30px' }} />
                    </header>
                </div>

                <div className="caja-datos" style={{ marginTop: '10px' }}>
                        <h2>Registro de Contratacion de servicio</h2>
                        <div className="fila-datos encabezado" style={{ width: '96.5vw' }}>
                            {/* Encabezados */}
                            <span>ID</span>
                            <span>Nombre</span>
                            <span>Apelidos</span>
                            <span>Correo</span>
                            <span>Direccion</span>
                            <span>C. Problema</span>
                            <span>D. Requisitos</span>
                            <span>D. Requisitos 2</span>
                            <span>D. Problema</span>
                            <span>Eliminar</span>
                        </div>
                        <div className="scroll-container">
                        {todosLosDatos.map((dato, index) => (
                            <div key={index}>
                                {/* Datos de cada registro */}
                                <div className="fila-datos">
                                    {/* Agrega botones de eliminar y modificar */}
                                    <span>
                                        <button onClick={() => eliminarDato(index)} style={{ marginLeft: '0px', width: '90px' }}>Eliminar</button>
                                    </span>
                                </div>

                            </div>
                        ))}
                    </div><br/>

                <footer className="footer">
                    <div className="footer-bottom">
                        <p>Seccion de gestion de comunicaciones de nuestro sistema interno de la empresa DATATECH DEEP SOLUTION</p>
                    </div>
                </footer>
            </div>
        </div>
    </div>

    );
}


export default GComunicaciones;
